import React from 'react';
import './App.css';

const BookDetailed = ({ book, onBookClick, onClick }) => {
  return (
    <li key={book.id}>
      <img alt="" src={book.img} />
      <div className="info">
        <div className="title">{ book.name }</div>
        <div className="desc"><button onClick={() => onBookClick(true)}>An incredible book about incredible things that you should definitely read.</button></div>
        <button onClick={() => onClick(book.name)}>Select Book</button>
      </div>
    </li>
  );
}

export default BookDetailed;
